import './App.css';
import Header from './components/Header';
import { BrowserRouter, Route, Switch, Redirect } from 'react-router-dom';

import Characters from './pages/Characters';
import Comics from './pages/Comics';
import Stories from './pages/Stories';

function App() {
  return (
    <div className="App">
        <BrowserRouter>
            <Header />
            <Redirect
            from="/"
            to="/characters" />
            <Switch>
                <Route
                path="/characters"
                component={Characters} />
                <Route
                path="/comics"
                component={Comics} />
                <Route
                path="/stories"
                component={Stories} />
            </Switch>
        </BrowserRouter>
    </div>
  );
}
export default App;
